import React from 'react';
import {Route, Switch} from 'react-router-dom';
import Registeration from './components/registeration/Registeration';
import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <Switch>
        <Route path="/" component={Registeration} />
        </Switch>
    </div>
  );
}

export default App;
